import PropTypes from 'prop-types'
//Layout
import Nav from '../layout/Nav'
import Footer from '../layout/Footer'
//Carousel
const Coverflow = require('react-coverflow')


const Index = props => {
  const fn = () => {
    console.log('clicked');  
  }
  return (
    <>
    <h1>homepage</h1>
      <Coverflow
        width={960}
        height={480}
        displayQuantityOfSide={2}
        navigation={false}
        enableHeading={false}
      >
        <div
          onClick={() => fn()}
          onKeyDown={() => fn()}
          role="menuitem"
          tabIndex="0"
        >
          <img
            src=''
            alt='title or description'
            style={{ display: 'block', width: '100%' }}
          />
        </div>
        <img src='' alt='title or description' data-action="/"/>
        <img src='' alt='title or description' data-action="/"/>
      </Coverflow>   
    </>
  )
}


Index.propTypes = {

}

export default Index
